    'Search for a product' => 'Procurar un produto',
    'Enter your product name' => 'Introduce o nome do teu produto',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'A descrición breve é unha frase curta que describe o teu produto.<br />Aparecerá na parte superior da páxina de produto da túa tenda, nas listaxes de produtos e nas páxinas de resultados dos motores de busca (así que é importante para a SEO). Para dar máis detalles sobre o teu produto, emprega a sección "Descrición".',
    'Search and add a related product' => 'Pesquisar e engadir un produto relacionado',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Emprega unha vírgula para crear etiquetas separadas. Ex.: vestido, algodón, vestidos de festa.',
    'Per kilo, per litre' => 'Por quilo, por litro',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Combinar varios atributos, ex.: "Talle: todos", "Cor: vermella".',
    'To have a different title from the product name, enter it here.' => 'Para ter un título diferente do nome do produto, introdúceo aquí.',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Título público para a páxina do produto e para os motores de busca. Déixao baleiro para emprega-lo nome do produto. O número de caracteres restantes aparece á esquerda do campo.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Para ter unha descrición diferente ca da túa descrición breve nas páxinas de resultados de busca, escríbea aquí.',
    'To which product the page should redirect?' => 'A que produto debería redirixir a páxina?',
    'Only letters and the minus (-) character are allowed.' => 'Só son permitidos letras e símbolos guion (-)',
    'Search name' => 'Pesquisar polo nome',
    'Search ref.' => 'Pesquisar por ref.',
    'Search category' => 'Procurar categoría',
    'Permanently delete this product.' => 'Eliminar este produto permanentemente.',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'O produto é un pack (unha combinación de polo menos dous produtos existentes), un produto virtual (un ficheiro descargable, servizo, etc.) ou simplemente un produto físico estándar?',
    'Search categories' => 'Pesquisar por categorías',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Esta combinación ten un prezo diferente? É máis barata ou máis cara có prezo de venda predeterminado?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'As combinacións son as diferentes variacións dun produto, nas cales os atributos coma o seu talle, peso ou cor van tomando diferentes valores. Para crear unha combinación, é preciso que primeiro crees os atributos do teu produto. Para facer isto vai a Catálogo > Atributos e Características!',
    'This is the human-readable URL, as generated from the product\'s name. You can change it if you want.' => 'Esta é a URL lexible para humanas, como a xerada a partir do nome do produto. Podes mudala se queres.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Sen redirección (404) = Non redirixir a ningures e amosar unha páxina 404 de "Non se atopou".',
    'You can specify product reference(s) for each associated supplier. Click "Save" after changing selected suppliers to display the associated product references.' => 'Podes especificar referencia(s) de produto para cada distribuidora asociada. Preme "Gardar" despois de mudar as distribuidoras seleccionadas para amosar as referencias dos produtos asociadas.',
    'This interface allows you to specify the warehouse in which the product is stocked.' => 'Esta interface permíteche especificar o almacén no que está depositado o produto.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Tamén é posible especifica-la localización dentro do almacén para cada produto ou combinación.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Número de días durante os que a clientela pode acceder a este ficheiro. Establéceo en cero para o acceso ilimitado.',
    'The full filename with its extension (e.g. Book.pdf)' => 'O nome completo do ficheiro coa súa extensión (ex. Libro.pdf)',
    'Number of downloads allowed per customer. Set to 0 for unlimited downloads.' => 'Número de descargas permitidas por clienta. Establecer en 0 para descargas ilimitadas.',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'A cantidade mínima requirida para mercar este produto (establécea en 1 para desactivar esta característica). Ex.: se se establece en 3, as clientas só poderán adquiri-lo produto se levan polo menos unha cantidade de 3.',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'As combinacións son as diferentes variacións dun produto, nas cales os atributos coma o seu talle, peso ou cor van tomando diferentes valores. O teu produto precisa combinacións?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Axustes avanzados en [1][2]Combinacións[/1]',
    'How many products should be available for sale?' => 'Cantos produtos deben estar dispoñibles para a venda?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Axustes avanzados en [1][2]Cantidades[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Este é o prezo de venda ao que lle pretendes vender este produto á túa clientela. O prezo con taxas incluídas mudará de acordo coa regra de taxas que selecciones.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Axustes avanzados en [1][2]Prezos[/1]',
    'Tags are meant to help your customers find your products via the search bar.' => 'As etiquetas teñen o propósito de axudarlles as clientas a atopa-los teus produtos a través da barra de pesquisa.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Escolle termos e palabras chave que as túas clientas empregarán para procurar este produto e asegúrate de que estás a ser coherente coas etiquetas que xa poidas ter empregado.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Non tódalas tendas venden produtos novos. Esta opción permíteche indica-lo estado do produto. Pode ser necesaria nalgúns mercados.',
    'ISBN is used internationally to identify books and their various editions.' => 'O ISBN emprégase internacionalmente para identificar libros e as súas diversas edicións.',
    'This type of product code is widely used in the United States, Canada, the United Kingdom, Australia, New Zealand and in other countries.' => 'Este tipo de código de produto emprégase amplamente nos Estados Unidos, Canadá, o Reino Unido, Australia, Nova Zelanda e outros países.',
    'This type of product code is specific to Europe and Japan, but is widely used internationally. It is a superset of the UPC code: all products marked with an EAN will be accepted in North America.' => 'Este tipo de código de produto é específico da Europa e do Xapón, pero emprégase amplamente no ámbito internacional. É un superconxunto do código UPC: tódolos produtos marcados cun EAN aceptaranse na Nortamérica.',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Este é o prezo ao que lle pretendes vender este produto á túa clientela. O prezo con taxas incluídas mudará de acordo coa regra de taxas que selecciones.',
    'Some products can be purchased by unit (per bottle, per pound, etc.),  and this is the price for one unit. For instance, if you’re selling fabrics, it would be the price per meter.' => 'Algúns produtos pódense mercar por unidade (por botella, por quilo, etc.), e este é o prezo dunha unidade. Por exemplo, se estás a vender tecidos, debería ser o prezo por metro.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'O prezo de custo é o prezo que pagaches polo produto. Non inclúe as taxas. Debería ser menor có prezo de venda: a diferenza entre os dous será a túa marxe.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Podes establecer prezos específicos para clientas que pertencen a diferentes grupos, diferentes países, etc.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Ás veces unha clienta pode encaixar en múltiples regras de prezos. As prioridades permítenche definir qué regras se aplicarán en primeiro lugar.',
    'Invalid token' => 'Indicador non válido',
    'This is the main image for your category, displayed in the category page. The category description will overlap this image and appear in its top-left corner.' => 'Esta é a imaxe principal para a túa categoría, que se ha amosar na páxina da categoría. A descrición da categoría superporase a esta imaxe e aparecerá na súa esquina superior esquerda.',
    'Only letters, numbers, underscore (_) and the minus (-) character are allowed.' => 'Soamente están permitidos os seguintes caracteres: letras, números, guión baixo (_) e guión medio (-).',
    'You now have three default customer groups.' => 'Agora tes tres grupos de clientela predeterminados.',
    'Mark all of the customer groups which you would like to have access to this category.' => 'Marca tódolos grupos de clientela que che gustaría que tivesen acceso a esta categoría.',
  ),
